-- 更新索引
DROP INDEX IF EXISTS post_tid;
DROP INDEX IF EXISTS post;
DROP INDEX IF EXISTS p_floor;
DROP INDEX IF EXISTS comment_pid;
DROP INDEX IF EXISTS comment;

-- 1. 帖子相关
-- 用于：查看帖子详情（按楼层排序）、计算分页
CREATE INDEX IF NOT EXISTS idx_pr_post_thread_floor ON pr_post(thread_id, floor);
-- 用于：时间机器模式下查看帖子（按时间过滤）、判断帖子是否存在
CREATE INDEX IF NOT EXISTS idx_pr_post_thread_time ON pr_post(thread_id, time);
-- 用于：查看用户发帖记录（按时间排序）
CREATE INDEX IF NOT EXISTS idx_pr_post_user_time ON pr_post(user_id, time);
-- 用于：全吧时间线（首页）、搜索过滤
CREATE INDEX IF NOT EXISTS idx_pr_post_time ON pr_post(time);

-- 2. 评论相关
-- 用于：显示楼中楼（按时间排序）
CREATE INDEX IF NOT EXISTS idx_pr_comment_post_time ON pr_comment(post_id, time);
-- 用于：查看用户评论记录
CREATE INDEX IF NOT EXISTS idx_pr_comment_user_time ON pr_comment(user_id, time);
-- 用于：全吧时间线（首页）
CREATE INDEX IF NOT EXISTS idx_pr_comment_time ON pr_comment(time);

-- 3. 吧务/删帖记录相关
-- 用于：判断帖子是否在某个时间点被删除（时间机器核心逻辑）、查看单帖日志
CREATE INDEX IF NOT EXISTS idx_un_post_thread_time ON un_post(thread_id, operation_time);
-- 用于：查看全吧管理日志（按时间排序）
CREATE INDEX IF NOT EXISTS idx_un_post_time ON un_post(operation_time);

-- 添加视频元数据
CREATE TABLE IF NOT EXISTS "video_metadata" ("id" text NOT NULL, "metadata" text, PRIMARY KEY ("id"));
